#include<iostream>
#include<vector>
using namespace std;

vector<vector<long long int> > multiply(vector<vector<int> > a, vector<vector<int> > b , long long mod){
    vector<vector<long long int> > c(a.size(), vector<long long int> (b.back().size()));
    for(int i = 0; i<a.size(); i++){
        for(int j = 0; j<b.back().size(); j++){
            c[i][j] = 0;
            for(int k = 0; k<b.size(); k++){
                c[i][j] += (a[i][k] * b[k][j]) % mod; 
            }
        }
    }
    return c;
}

int main(){
    int a,b;
    cin>>a>>b;
    vector<vector<int> > ab (a, vector<int>(b));
    for(int i = 0; i<a; i++){
        for(int j = 0; j<b; j++){
            int x;
            cin>>x;
            ab[i][j] = x;

        }
    }
    int c,d;
    cin>>c>>d;
    vector<vector<int> > cd (c, vector<int>(d));
    for(int i = 0; i<c; i++){
        for(int j = 0; j<d; j++){
            int x;
            cin>>x;
            cd[i][j] = x;

        }
    }
    if(b == c){
            vector<vector<long long int> > ans ;
            ans =  multiply(ab, cd, 1e9+7);

            for(int i = 0; i<ab.size(); i++){
                for(int j = 0; j<cd.back().size(); j++){
                    cout<< ans[i][j]<<' ';

                }
                cout<<endl;

            }
    }
    else cout<<"-1";




    return 0;
}
